import React from 'react';
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'
import Card from "react-bootstrap/Card";
import BottomNavigation from '@material-ui/core/BottomNavigation';
import BottomNavigationAction from '@material-ui/core/BottomNavigationAction';
import Facebook from '@material-ui/icons/Facebook';
import Twitter from '@material-ui/icons/Twitter';
import Instagram from '@material-ui/icons/Instagram';
import Pinterest from '@material-ui/icons/Pinterest';


class Footer extends React.Component{

    render(){
        return (
            <Container>
                        <BottomNavigation>
                            <BottomNavigationAction label="Recents" value="recents" icon={<Twitter />} />
                            <BottomNavigationAction label="Favorites" value="favorites" icon={<Instagram />} />
                            <BottomNavigationAction label="Nearby" value="nearby" icon={<Pinterest />} />
                            <BottomNavigationAction label="Folder" value="folder" icon={<Facebook />} />
                            <p>717 Union Street 94133 San Francisco- USA</p>
                        </BottomNavigation>
            </Container>
        );
    }
}

export default Footer;
